import React, { useState, useEffect, useRef } from 'react';
import { Box, makeStyles, Fade } from '@material-ui/core';
import { config } from 'Constants';
import { GetRandomInt, OptAnimate } from 'Utils';

const great =
  'data:image/png;base64,';
const excellent =
  'data:image/png;base64,';
const hatrick =
  'data:image/png;base64,';
const onFire =
  'data:image/png;base64,';

const levelUp =
  'data:image/png;base64,';

const videoTutorial =
  'data:image/png;base64,';

const challengeComplete =
  'data:image/png;base64,';
window.greatAnimation = null;
window.hatrickAnimation = null;
window.onFireAnimation = null;

const useStyles = makeStyles((theme) => ({
  animation: {
    position: 'absolute',
    zIndex: 25,
    top: '50%',
    marginTop: '-70px',
    height: '140px',
    width: '400px',
    backgroundSize: '100%',
    backgroundRepeat: 'no-repeat',
    pointerEvents: 'none',
    maxWidth: '100%',
    [theme.breakpoints.up('sm')]: {
      left: '50%',
      marginLeft: '-200px',
    },
  },
  great: {
    backgroundImage: `url(${great})`,
  },
  excellent: {
    backgroundImage: `url(${excellent})`,
  },
  hatrick: {
    backgroundImage: `url(${hatrick})`,
  },
  onFire: {
    backgroundImage: `url(${onFire})`,
  },

  levelUp: {
    marginTop: '30px',
    backgroundImage: `url(${levelUp})`,
  },
  videoTutorial: {
    marginTop: '30px',
    backgroundImage: `url(${videoTutorial})`,
  },
  challengeComplete: {
    marginTop: '30px',
    backgroundImage: `url(${challengeComplete})`,
  },
  hide: {
    display: 'none',
  },
}));

const Animations = React.memo(({ number }) => {
  const [stateRef, setStateRef] = useState({
    great: false,
    hatrick: false,
    onFire: false,

    greatDone: false,
    hatrickDone: false,
    onFireDone: false,
    number,
    randNum: 0,
  });

  const styled = useStyles();
  useEffect(() => {
    if (number === stateRef.number) return;
    if (number < 2) {
      setStateRef({
        ...stateRef,
        number,
        great: false,
        hatrick: false,
        onFire: false,
        greatDone: false,
        hatrickDone: false,
        onFireDone: false,
      });
    } else if (number > 4) {
      setStateRef({
        ...stateRef,
        number,
      });
    } else if (number === 2 && !stateRef.great && !stateRef.greatDone) {
      setStateRef({
        ...stateRef,
        randNum: GetRandomInt(0, 100) % 2 === 0 ? styled.great : styled.excellent,
        great: true,
        greatDone: true,
        hatrick: false,
        onFire: false,
        number,
      });
      clearTimeout(window.greatAnimation);
      window.greatAnimation = setTimeout(() => {
        setStateRef({
          ...stateRef,
          great: false,
          greatDone: true,
        });
      }, config.greetingAnimateHideTime);
    } else if (number === 3 && !stateRef.hatrick && !stateRef.hatrickDone) {
      setStateRef({
        ...stateRef,
        great: false,
        hatrick: true,
        onFire: false,
        hatrickDone: true,
      });
      clearTimeout(window.hatrickAnimation);
      window.hatrickAnimation = setTimeout(() => {
        setStateRef({
          ...stateRef,
          hatrick: false,
          hatrickDone: true,
        });
      }, config.greetingAnimateHideTime);
    } else if (number === 4 && !stateRef.onFire && !stateRef.onFireDone) {
      setStateRef({
        ...stateRef,
        great: false,
        hatrick: false,
        onFire: true,
        onFireDone: true,
      });
      clearTimeout(window.onFireAnimation);
      window.onFireAnimation = setTimeout(() => {
        setStateRef({
          ...stateRef,
          onFire: false,
          onFireDone: true,
        });
      }, config.greetingAnimateHideTime);
    }
  }, [number, stateRef, styled.excellent, styled.great]);

  useEffect(() => {
    return () => {
      clearTimeout(window.greatAnimation);
      clearTimeout(window.hatrickAnimation);
      clearTimeout(window.onFireAnimation);
    };
  }, []);

  return (
    <>
      <GreetingAnimation checked={stateRef.great}>
        <Box className={`${styled.animation} ${stateRef.randNum}`} />
      </GreetingAnimation>
      <GreetingAnimation checked={stateRef.hatrick}>
        <Box className={`${styled.animation} ${styled.hatrick}`} />
      </GreetingAnimation>
      <GreetingAnimation checked={stateRef.onFire}>
        <Box className={`${styled.animation} ${styled.onFire}`} />
      </GreetingAnimation>
    </>
  );
});

export default Animations;

export const GreetingAnimation = React.memo(({ children, checked, unloadTime }) => {
  return (
    <Fade in={checked} {...(checked ? { timeout: config.greetingAnimateTime } : { timeout: unloadTime || 350 })}>
      {children}
    </Fade>
  );
});

export const LevelUpAnimation = () => {
  const ref = useRef();
  const styled = useStyles();
  useEffect(() => {
    const refEl = ref.current;
    refEl.classList.remove(`${styled.hide}`);
    new OptAnimate().Animate(refEl, 'slideInUp', 1000, () => {
      new OptAnimate().AnimateWithDelay(refEl, 'tada', 400, null, false, 300);
      new OptAnimate().AnimateWithDelay(
        refEl,
        ['fadeOut'],
        500,
        () => {
          refEl.classList.remove(`${styled.hide}`);
        },
        true,
        1500
      );
    });
  }, [styled.hide]);

  return <Box ref={ref} pt={8} className={`${styled.animation} ${styled.levelUp} ${styled.hide}`} />;
};

